var game;
var gameLoaded = false;
var createOnLoaded = false;
var count1 = 0,
    count2 = 0,
    count3 = 0,
    str, arr, count, letter1, letter2, letter3, letter4, flag = false
window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        this.textures.addBase64('words_4', assets.words_4);
        this.textures.addBase64('win_bg', assets.win_bg);
        this.textures.addBase64('right', assets.right);
        this.textures.addBase64('prompt', assets.prompt);
        this.textures.addBase64('h2', assets.h2);
        this.textures.addBase64('h1', assets.h1);
        this.textures.addBase64('w2', assets.w2);
        this.textures.addBase64('w1', assets.w1);
        this.textures.addBase64('logo', assets.logo);
        this.textures.addBase64('paper_ball', assets.paper_ball);
        this.textures.addBase64('paper_ball1', assets.paper_ball1);
        this.textures.addBase64('btn_retry', assets.btn_retry);
        this.textures.addBase64('hat', assets.hat);
        this.textures.addBase64('bg', assets.bg);
        this.textures.addBase64('door', assets.door);
        this.textures.addBase64('words_s', assets.words_s);
        this.textures.addBase64('a1', assets.a1);
        this.textures.addBase64('wrong', assets.wrong);
        this.textures.addBase64('a2', assets.a2);
        this.textures.addBase64('open_door', assets.open_door);
        this.textures.addBase64('locked', assets.locked);
        this.textures.addBase64('t2', assets.t2);
        this.textures.addBase64('open_esc', assets.open_esc);
        this.textures.addBase64('t1', assets.t1);
        this.textures.addBase64('btn_download', assets.btn_download);


        var imageCount = 25;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        //背景
        this.bg = this.add.image(0, 0, 'bg').setOrigin(0, 0)
        this.logo = this.add.image(0, 0, 'logo').setOrigin(0, 0)

        // 门
        this.door = this.add.image(45, 250, 'door').setOrigin(0, 0)
        this.open_door = this.add.image(45, 253, 'open_door').setOrigin(0, 0)
        this.open_door.visible = 0

        //小词盘
        this.words_s = this.add.image(245, 340, 'words_s').setOrigin(0, 0)

        //大词盘
        this.words = this.add.image(144, 300, 'words_4').setOrigin(0, 0)
        this.words.visible = false

        //纸团
        this.paper_ball = this.add.image(344, 600, 'paper_ball1').setOrigin(0, 0).setInteractive()
        this.paper_ball1 = this.add.image(344, 600, 'paper_ball').setOrigin(0, 0).setInteractive()
        this.paper_ball1. visible = 0

        //帽子
        this.hat = this.add.image(44, 600, 'hat').setOrigin(0, 0)
        this.hat.scaleX = 0.7
        this.hat.scaleY = 0.7

        //提示
        this.prompt = this.add.image(250, 450, 'prompt').setInteractive()
        this.prompt.scaleX = 0
        this.prompt.scaleY = 0



        //引导
        this.showGuide('open_esc', 230, 420)

        //点击门
        this.clickDoor()


        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    //引导
    showGuide(name, X, Y) {
        this.guide = this.add.image(X, Y, name).setOrigin(0, 0)
        this.guide.scaleX = 0.5
        this.guide.scaleY = 0.5
        // rotation: -0.15,
        this.guide.setInteractive();


        this.tweens.add({
            targets: [this.guide],
            // rotation: -0.15,
            //  scaleX: 1.05,
            // scaleY: 1.02,
            x: X,
            duration: 200,
            callbackScope: this,
            onComplete: function (tween) {
                // b1.visible = false;
                // b1.destroy();
                this.tweens.add({
                    targets: [this.guide],
                    // rotation: -0.15,
                    //  scaleX: 1,
                    //  scaleY: 1,
                    x: X + 20,
                    duration: 200,
                    callbackScope: this,
                    onComplete: function (tween) {
                        // b1.visible = true;
                    }
                });
            }
        })
        this.inter_guide = setInterval(() => {
            this.tweens.add({
                targets: [this.guide],
                // rotation: -0.15,
                //  scaleX: 1.05,
                // scaleY: 1.02,
                x: X,
                duration: 200,
                callbackScope: this,
                onComplete: function (tween) {
                    // b1.visible = false;
                    // b1.destroy();
                    this.tweens.add({
                        targets: [this.guide],
                        // rotation: -0.15,
                        //  scaleX: 1,
                        //  scaleY: 1,
                        x: X + 20,
                        duration: 200,
                        callbackScope: this,
                        onComplete: function (tween) {
                            // b1.visible = true;
                        }
                    });
                }
            })
        }, 500);
    }


    //点击小词盘，弹出大词盘，显示单词
    clickWords_s() {
        this.words_s.setInteractive()
        this.words_s.on('pointerdown', () => {
            // this.close()
            this.words.visible = true
            //显示字母
            //字母
            this.h1 = this.add.image(215, 440, 'h1')
            this.h1.setDepth(2)
            this.h1.setInteractive()
            this.h1.on('pointerdown', () => {
                //调用判断函数
                var l = this.JudgingWords("h", 4, "what")
                this.showWord()
                if (l == false) {
                    setTimeout(() => {
                        letter1.visible = false
                        letter2.visible = false
                        letter3.visible = false
                        letter4.visible = false
                    }, 500);
                    this.symbol("wrong", 360, 360)
                }
            }, this)

            this.a1 = this.add.image(300, 440, 'a1')
            this.a1.setDepth(2)
            this.a1.setInteractive()
            this.a1.on('pointerdown', () => {
                //调用判断函数
                var a = this.JudgingWords("a", 4, "what")
                this.showWord()
                if (a == false) {
                    setTimeout(() => {
                        letter1.visible = false
                        letter2.visible = false
                        letter3.visible = false
                        letter4.visible = false
                    }, 500);
                    this.symbol("wrong", 360, 360)
                }
            }, this)

            this.w1 = this.add.image(215, 520, 'w1')
            this.w1.setDepth(2)
            this.w1.setInteractive()
            this.w1.on('pointerdown', () => {
                //调用判断函数
                var t = this.JudgingWords("w", 4, "what")
                this.showWord()
                if (t == false) {
                    setTimeout(() => {
                        letter1.visible = false
                        letter2.visible = false
                        letter3.visible = false
                        letter4.visible = false
                    }, 500);
                    this.symbol("wrong", 360, 360)
                }
            }, this)

            this.t1 = this.add.image(300, 520, 't1')
            this.t1.setDepth(2)
            this.t1.setInteractive()
            this.t1.on('pointerdown', () => {
                //调用判断函数
                var e = this.JudgingWords("t", 4, "what")
                this.showWord()
                if (e == true) {
                    setTimeout(() => {
                        // 隐藏所有组件
                        // if (count1 == 0) {
                        //     this.guide.visible = false
                        // }
                        this.words.visible = false
                        this.h1.visible = false
                        this.a1.visible = false
                        this.w1.visible = false
                        this.t1.visible = false
                        letter1.visible = false
                        letter2.visible = false
                        letter3.visible = false
                        letter4.visible = false
                        clearInterval(this.inter_guide)
                        count1 = 0


                    }, 500);
                    setTimeout(() => {
                        this.door.visible = false
                        this.open_door.visible = true
                    }, 1000);
                    setTimeout(() => {
                        this.showWin()
                    }, 1500);
                    this.symbol("right", 360, 360)
                } else if (e == false) {
                    setTimeout(() => {
                        letter1.visible = false
                        letter2.visible = false
                        letter3.visible = false
                        letter4.visible = false
                    }, 500);
                    this.symbol("wrong", 360, 360)
                }
            }, this)

        }, this)
    }

    // 判断单词是否正确，三个参数，1，点击的字母，2.单词长度 3.正确单词拼写 
    JudgingWords(a, n, word) {
        n = parseInt(n)
        a = String(a)
        if (typeof (str) == "undefined" && typeof (arr) == "undefined") {
            str = "";
            arr = [];
            str = str + a;
            count = 0
            count++
            arr.push(a)
        } else {
            arr.push(a);
            count++
            str = str + a;
        }
        if (str.length == n) {
            if (str == word) {
                setTimeout(() => {
                    str = "";
                    count = 0
                    arr = []
                }, 500);
                return true;
            } else {
                setTimeout(() => {
                    str = "";
                    count = 0
                    arr = []
                }, 500);
                return false
            }
        }
    }

    // 显示框单词
    showWord() {
        if (str.length == 1) {
            letter1 = this.add.image(175, 360, arr[0] + "2").setOrigin(0, 0);
            letter1.setDepth(2)
            count3 = 1
        }
        if (str.length == 2) {
            letter2 = this.add.image(215, 360, arr[1] + "2").setOrigin(0, 0);
            letter2.setDepth(2)
            count3 = 2
        }
        if (str.length == 3) {
            letter3 = this.add.image(255, 360, arr[2] + "2").setOrigin(0, 0);
            letter3.setDepth(2)
            count3 = 3
        }
        if (str.length == 4) {
            letter4 = this.add.image(295, 360, arr[3] + "2").setOrigin(0, 0);
            letter4.setDepth(2)
            count3 = 4
        }

    }

    //点击门抖动，引导
    clickDoor() {
        //点击门抖动，出现锁
        this.door.setInteractive();
        this.door.on('pointerdown', function (pointer) {
            // 门抖动
            this.tweens.add({
                targets: [this.door],
                // rotation: -0.15,
                scaleX: 1.05,
                // scaleY: 1.02,
                duration: 100,
                callbackScope: this,
                onComplete: function (tween) {
                    // b1.visible = false;
                    // b1.destroy();
                    this.tweens.add({
                        targets: [this.door],
                        // rotation: -0.15,
                        scaleX: 1,
                        scaleY: 1,
                        duration: 100,
                        callbackScope: this,
                        onComplete: function (tween) {
                            // b1.visible = true;
                        }
                    });
                }
            })
            if (count1 == 0) {
                //指示门的箭头消失
                this.guide.visible = false
                clearInterval(this.inter_guide)
                setTimeout(() => {
                  
                    //纸团闪烁
                    this.showPaper()
                    //开启纸团点击
                    this.clickPaper()

                }, 300);
            }
            count1 = 1

            //出现锁
            var locked = this.add.image(135, 350, 'locked')
            locked.alpha = 0;

            this.tweens.add({
                targets: [locked],
                // rotation: -0.15,
                alpha: 1,
                scaleX: 1.05,
                scaleY: 1.02,
                duration: 500,
                callbackScope: this,
                onComplete: function (tween) {
                    // b1.visible = false;
                    // b1.destroy();
                    this.tweens.add({
                        targets: [locked],
                        // rotation: -0.15,
                        alpha: 0,
                        scaleX: 1,
                        scaleY: 1,
                        duration: 500,
                        callbackScope: this,
                        onComplete: function (tween) {
                            // b1.visible = true;
                        }
                    });
                }
            })

        }, this)
    }

    //纸团闪烁
    showPaper() {
        this.paper_ball1.visible = 1
        this.paper_interval = setInterval(() => {
            setTimeout(() => {
                this.paper_ball1.visible = 0
            }, 300);
            setTimeout(() => {
                this.paper_ball1.visible = 1
            }, 600);
        }, 600);
    }

    //点击纸团，出现提示
    clickPaper(){
        this.paper_ball.on('pointerdown',()=>{
            this.paper_ball1.scaleX = 0
            this.paper_ball1.scaleY = 0
            clearInterval(this.paper_interval)
            this.tweens.add({
                targets:[this.prompt],
                scaleX:1,
                scaleY:1,
                duration:500
            })
            //调用clickPrompt函数
            this.clickPrompt()
            //调用小词盘点击事件
            this.clickWords_s()
        },this)
        this.paper_ball1.on('pointerdown',()=>{
            this.paper_ball1.scaleX = 0
            this.paper_ball1.scaleY = 0
            clearInterval(this.paper_interval)
            this.tweens.add({
                targets:[this.prompt],
                scaleX:1,
                scaleY:1,
                duration:500
            })
            //调用clickPrompt函数
            this.clickPrompt()
            //调用小词盘点击事件
            this.clickWords_s()
        },this)
    }

    //点击提示，提示消失
    clickPrompt(){
        this.prompt.on('pointerdown',()=>{
            this.tweens.add({
                targets:[this.prompt],
                scaleX:0,
                scaleY:0,
                duration:500
            })
        },this)
    }

    //弹出下载按钮
    showWin() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics.alpha = 0.85;
        graphics.setDepth(8);
        graphics.fillRectShape(rect);
        var winPanel = this.add.sprite(game.config.width / 2, game.config.height / 2 + 500, "win_bg");
        winPanel.setDepth(10);

        // show panel
        this.tweens.add({
            targets: [winPanel],
            y: game.config.height / 2 - 120,
            duration: 1000,
            ease: 'Back',
            callbackScope: this,
            onComplete: function (tween) {
                //原地弹出
                var downloadBtn = this.add.sprite(game.config.width / 2 + 50, game.config.height / 2 + 40, 'btn_download').setInteractive();
                downloadBtn.setDepth(11);

                this.tweens.add({
                    targets: [downloadBtn],
                    y: game.config.height / 2 + 40,
                    duration: 300
                })

                downloadBtn.on('pointerdown', function (pointer) {
                    landingPage();
                }, this);
                downloadBtn.on('touchstart', function (pointer) {
                    landingPage();
                }, this);

                //原地弹出
                var retryBtn = this.add.sprite(game.config.width / 2 - 87, game.config.height / 2 + 40, 'btn_retry').setInteractive();
                retryBtn.setDepth(11);
                retryBtn.on('pointerdown', function (pointer) {
                    this.scene.start("PlayGame")
                }, this);
                retryBtn.on('touchstart', function (pointer) {
                    this.scene.start("PlayGame")
                }, this);



                downloadBtn.scaleX = 0.8;
                downloadBtn.scaleY = 0.8;
                retryBtn.scaleX = 0.8;
                retryBtn.scaleY = 0.8;
                this.tweens.add({
                    targets: [downloadBtn, retryBtn],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 250,
                    ease: 'Back'
                });
            }
        });
    }

    //符号
    symbol(symbol, x, y) {
        var right = this.add.image(x, y, symbol);
        right.setDepth(2)
        right.scaleX = 0.5
        right.scaleY = 0.5
        console.log(this)
        this.tweens.add({
            targets: [right],
            rotation: 0.15,
            duration: 200,
            callbackScope: this,
            onComplete: function (tween) {
                this.tweens.add({
                    targets: [right],
                    rotation: -0.15,
                    duration: 200,
                    callbackScope: this,
                    onComplete: function (tween) {
                        right.destroy()
                    }
                });
            }
        });

    }


    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

